window.bookSummaryJSON = "<p>From <i>New York Times</i> best seller, Pepper Winters, comes a spin-off novella featuring Sully and Jinx from the five x <i>USA Today</i> best-selling series, Goddess Isles. Please listen after book five in Goddess Isles (<i>Fifth a Fury</i>).</p> <p>Features cameos by Jethro and Nila Hawk from the Indebted Series!</p> <p>“There was a wedding and vows and a happily ever after...but there was also lust and fantasy”.</p> <p>Sullivan Sinclair has high-powered friends as well as his new family. Invited to attend a masquerade at Jethro’s Hawksridge Hall, he agrees.</p> <p>Eleanor Sinclair has a new husband and untold wealth at her fingertips. While living on an island in the Java Sea, their lives are their own. However, a simple trip to England has both of them missing the tropics of home.</p> <p>A monster and a goddess who have a special power to escape.</p> <p>A fantasy that Sully dares to share.</p> <p>A visit to Euphoria like no other.</p>"; 
